&amp;#039;VIVA ZWEI 2Step&amp;#039; are DJ Sets and Video Sets combined. Some of the best DJs and VJs pair up to produce a stunning experience. All running approx 1 hour.
These are TV Recordings from back in the days, when VIVA ZWEI was shut down on 01.01.2002.
R.I.P.
